Verenigde Staten
Drama / Misdaad
112 minuten

goed

met Samuel L. Jackson, Julianne Moore en Edie Falco

Brenda Martin (Moore) strompelt aangeslagen de Eerste Hulp in Dempsy, New Jersey binnen en beweert dat een zwarte man haar auto 
heeft gestolen met haar vier jaar oude zoon op de achterbank. Detective Lorenzo Council (Jackson) heeft zijn bedenkingen bij 
Brenda's verhaal, maar start toch een grootschalig onderzoek, waarbij hij hulp krijgt van een groep moeders die naar verdwenen 
kinderen zoeken. Gedurende het onderzoek nemen de spanningen tussen het voornamelijk 'zwarte' Dempsy en het overwegend 'blanke' 
buurstadje Gannon toe.:
